answer = ""

def Bubble(sequence):
    for i in range(0, len(sequence) - 1):
        for i in range(0, len(sequence) - 1):
            # If needs to be swapped...
            num1, num2 = sequence[i], sequence[i + 1]
            # Swap
            if num1 > num2:
                sequence[i] = num2
                sequence[i + 1] = num1
    return sequence

def Insertion(sequence):
    for i in range(1, len(sequence)):
        done = False
        count = 0
        # Moves each item to the left until it's in the right place
        while not done:
            focus = sequence[i - count]
            left = sequence[i - 1 - count]
            if left > focus and (i - 1 - count) >= 0:
                storage = left
                sequence[i - 1 - count] = focus
                sequence[i - count] = storage
                count += 1
            else:
                done = True
    return sequence

def Merge(sequence):
    # Basically skips the unmerging process as this doesnt change the order of the items
    if len(sequence) > 1:
        count = 0
        done = False
        new = []
        while not done:
            if count < len(sequence) - 1:
                left = sequence[count]
                right = sequence[count + 1]
                # Combining
                if type(left) != list:
                    left = [left]
                if type(right) != list:
                    right = [right]
                for item in right:
                    left.append(item)
                # Sorts two merged lists using the insertion sort as this is more efficient than the bubble sort
                new.append(Insertion(left))
                count += 2
            else:
                done = True
        # Recursive call
        sequence = Merge(new)
    return sequence

